            <InputGroup className="mb-3" style={{marginTop:'20%',width: '300px'}}>
                <Form.Control
                    placeholder="Search"
                    aria-describedby="basic-addon2"
                />
                <InputGroup.Text id="basic-addon2">üîç</InputGroup.Text>
            </InputGroup>
        </div>
    );
}

export default AppSearch;
